import "./App.css";
import Experience from "./components/Experience.jsx";
import Skills from "./components/Skills";
import ZakLogo from "./components/ZakLogo";
import AnimatedCursor from "react-animated-cursor";

function App() {
  return (
    <div>
      <AnimatedCursor
        innerSize={8}
        outerSize={8}
        outerAlpha={0.2}
        innerScale={0.7}
        outerScale={5}
      />
      <main className="w-full flex h-screen">
        <ZakLogo />
        <Skills />
        <Experience
          title={"Software Engineer"}
          company={"hudl"}
          startDate={"May 2024"}
          endDate={"August 2024"}
          description={
            "Worked as a software engineering intern leveraged React, C#, and React Native to work on hudl messaging."
          }
        />
      </main>
    </div>
  );
}

export default App;
